import React, { useState, useEffect } from "react";
import DetalleBusquedaCategorias from "./DetalleBusquedaProducto";
import { useNavigate } from "react-router-dom";
import Swal from 'sweetalert2'
import EncabezadoCategorias from "./EncabezadoProducto";

const BusquedaProducto =(props)=>{
    const [Gestor, setGestor] = useState({
        Nombre_Producto: '',
        Categoria:''
    })

    const navigate = useNavigate();

    const teclaPresionada = (e) => {
        const { name, value } = e.target
        setGestor({ ...Gestor, [name]: value })
    }

    const ClickBtnNuevo = () => {
        props.CambiarIdCategoria(0)
        navigate("/Producto/DetalleCProducto")
    }

}
export default BusquedaProducto
